import React from "react";
import "./GoalItem.css";

const GoalItem = (props) => {
    const deleteHandler = (event) => {
        props.onDelete(props.id);
    }

    return (
        <li className="goal-item" onClick={deleteHandler}>{props.children}</li>
    )
}

export default GoalItem;
